import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.css';
import navbar from './navbar';
// import App from './App';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  navbar ,
  // <React.StrictMode>
  
  //   {/* <App /> */}
  // </React.StrictMode>
  navbar
);
